import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Inventory from "./Inventory";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Suppliers from "./Suppliers";
import Distributors from "./Distributors";
import Profile from "./Profile";
import AddInventory from "./AddInventory";
import AddDistributors from "./AddDistributors";
import AddSuppliers from "./AddSuppliers";


// ReactDOM.render(<App />, document.getElementById('root'));


const rootElement = document.getElementById("root");
ReactDOM.render(
    <BrowserRouter>
        <Switch>
            <Route exact path="/" component={App} />
            <Route path="/Inventory.js" component={Inventory} />
            <Route path="/Suppliers.js" component={Suppliers} />
            <Route path="/Distributors.js" component={Distributors} />
            <Route path="/Profile.js" component={Profile} />
            <Route path="/AddInventory.js" component={AddInventory} />
            <Route path="/AddDistributors.js" component={AddDistributors} />
            <Route path="/AddSuppliers.js" component={AddSuppliers} />
        </Switch>
    </BrowserRouter>,
    rootElement
);

// registerServiceWorker();
